import React from "react";
function Sticky() {
    return (
        <>
            <div className="px-6 flex items-center sm:flex-row justify-between flex-wrap">
                <div className="border border-gray-300 dark:border-gray-700 h-6 w-20 mb-4 md:mb-0 rounded-full flex items-center justify-center">
                    <span className="text-xs text-gray-800 dark:text-white font-normal">Badge</span>
                </div>
            </div>
        </>
    );
}
export default Sticky;
